import React, { useState } from 'react';
import './Dashboard.css'; // Use the same styling

const StudentDashboard = () => {
  const [results] = useState([
    { id: 1, subject: 'Math', score: 85 },
    { id: 2, subject: 'Science', score: 90 },
    { id: 3, subject: 'English', score: 78 },
  ]);

  return (
    <div className="dashboard">
      <h2>Student Dashboard</h2>
      <table>
        <thead>
          <tr>
            <th>Subject</th>
            <th>Score</th>
          </tr>
        </thead>
        <tbody>
          {results.map((r) => (
            <tr key={r.id}>
              <td>{r.subject}</td>
              <td>{r.score}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default StudentDashboard;
